//=========== cmart client ==========
DROP TABLE IF EXISTS client;
CREATE TABLE client (
	 client_id INT NOT NULL
	,first_name VARCHAR NOT NULL
	,last_name VARCHAR NOT NULL
	,is_pep VARCHAR NOT NULL
	,domicile_region VARCHAR NOT NULL
	,domicile_country VARCHAR NOT NULL
	,client_segment VARCHAR NOT NULL

);
//=========== cmart account ==========
DROP TABLE IF EXISTS account;
CREATE TABLE account (
	 account_id INT NOT NULL
	,account_region VARCHAR NOT NULL
	,client_id INT NOT NULL
	,booking_region VARCHAR NOT NULL
	,booking_country VARCHAR NOT NULL

);
//=========== cmart account_transaction ==========
DROP TABLE IF EXISTS account_transaction;
CREATE TABLE account_transaction (
	 account_1 INT NOT NULL
	,account_2 INT NOT NULL
	,amount DECIMAL(15,4) NOT NULL
	,transaction_date VARCHAR NOT NULL

);
//=========== cmart ticker ==========
DROP TABLE IF EXISTS ticker;
CREATE TABLE ticker (
	 ticker_id INT NOT NULL
	,ticker VARCHAR NOT NULL
	,market_sector VARCHAR NOT NULL
	,market_region VARCHAR NOT NULL

);
//=========== cmart portfolio ==========
DROP TABLE IF EXISTS portfolio;
CREATE TABLE portfolio (
	 portfolio_id INT NOT NULL
	,client_id INT NOT NULL
	,portfolio_name VARCHAR NOT NULL

);
//=========== cmart portfolio_transaction ==========
DROP TABLE IF EXISTS portfolio_transaction;
CREATE TABLE portfolio_transaction (
	 portfolio_transaction_id INT NOT NULL
	,portfolio_id INT NOT NULL
	,ticker_id INT NOT NULL
	,buy_sell VARCHAR NOT NULL
	,transaction_date VARCHAR NOT NULL
	,notional INT NOT NULL
	,price DECIMAL(15,4) NOT NULL

);
